			});
			document.getElementById('resetSVG').addEventListener('click', function () {

			});
			document.getElementById('panleft').addEventListener('click', function() {

			});

				instance.panRight(200);
			});
			document.getElementById('panup').addEventListener('click', function() {

		<!--Button Skip The Lab with popup confirm message-->
		<script>
			const serialButton = document.querySelector(".find-serial-btn");
				const popup = document.querySelector(".popup");
				const close = document.querySelector(".popup .close");

				function closePopup() {
				popup.classList.remove("clicked");
				}

				serialButton.onclick = function() {
				
				popup.classList.toggle("clicked");

				document.onkeyup = function(e) {
					if (e.keyCode === 27) {
					closePopup();
					}
				}
				}

				close.onclick = closePopup;
		</script>
